        <div id="splash-screen">
            <Box sx = {{fontSize: 300, color: "red"}}>Playlister</Box>
            <Box sx = {{fontSize: 100}}>Welcome to Playlister!</Box>
            <Box sx = {{width: "70%", fontSize: 50}}> Create Playlists. Publish Playlists. Browse Playlists. And so much more. With the only playlist app you will ever need... Playlister!</Box>
        </div>
    )
}
